import React from 'react';
import { Route } from 'react-router-dom';

import CollectionsOverview from '../../components/collections-overview/collections-overview.jsx';
import CategoryPage from '../category/category.jsx';

const ShopPage = ({ match }) => (
    <div className='shop-page'>
        <Route exact path={`${match.path}`} compomemt={CollectionsOverview} />
        <Route path={`${match.path}/:categoryId`} compomemt={CategoryPage} />
    </div>
);

export default ShopPage;
